import React from "react";
import Link from "next/link";
import Button from "@material-ui/core/Button";

export const ButtonLink = ({
  className,
  href,
  hrefAs,
  children,
  //   prefetch,
  variant,
  color
}) => (
  <Link href={href} as={hrefAs} prefetch>
    <a className={className}>{children}</a>
  </Link>
);

